#include <random>
#include <chrono>
#include <cmath>
#include "Nmer.h"

using namespace std;

int main(){

  Nmer prueba,n2;
  // prueba.loadSerialized("../datos/cadenaSimple.srl");
  prueba.sequenceADN(3,"ATACATCATTGTGG");
  prueba.list_Nmer();
  cout << prueba.size() << " " << prueba.length() << endl;
  n2 = prueba;
  cout << "Copia del Nmer:" << endl;
  n2.list_Nmer();
  cout << "Â¿Contiene la cadena de adn AC?" << endl;
  if(prueba.containsString("AC")){
    cout << "true" << endl;
  }
  else{
    cout << "false" << endl;
  }

  cout << "Creamos un nuevo Nmer y buscamos el prefijo TG en el arbol anterior." << endl;
  Nmer prex;
  prex = prueba.Prefix("TG");
  prex.list_Nmer();
  cout << prex.size() << " " << prex.length() << endl;

  cout << "Cojemos las cadenas que tienen menos frecuencia de 3." << endl;
  set <pair<string,int> ,OrdenCre > s = n2.rareNmer(3);

  for( auto it = s.begin(); it != s.end(); ++it ){
    cout << "( " << (*it).first << "," << (*it).second <<" ); " <<endl;
  }

  cout << "Cojemos las cadenas que tienen mas frecuencia de 2." << endl;
  set <pair<string,int> ,OrdenDecre > s2 = n2.commonNmer(2);

  for( auto it = s2.begin(); it != s2.end(); ++it ){
    cout << "( " << (*it).first << "," << (*it).second <<" ); " <<endl;
  }

  cout << "Cojemos las cadenas que tienen 3 caracteres." << endl;
  set <pair<string,int> ,OrdenCre > s3 = n2.level(3);

  for( auto it = s3.begin(); it != s3.end(); ++it ){
    cout << "( " << (*it).first << "," << (*it).second <<" ); " <<endl;
  }

  cout << "La union del primer Nmer consigo mismo es:" << endl;
  Nmer s4 = prueba.Union(prueba);

  s4.list_Nmer();

  cout << "Veamos si prueba esta totalmente incluida en n2 (su copia):" << endl;
  if( prueba.included(n2) ){
    cout << "El Nmer prueba tiene todos sus nodos en n2." << endl;
  }
  else{
    cout << "Algun nodo del Nmer prueba no esta en n2." << endl;
  }

  Nmer humano,humano2,raton,raton2,gusano,gusano2,mosca,mosca2,ebola,cebra;
  humano.sequenceADN(12,"");
  humano2.sequenceADN(12,"");
  raton.sequenceADN(12,"");
  raton2.sequenceADN(12,"");
  gusano.sequenceADN(12,"");
  gusano2.sequenceADN(12,"");
  mosca.sequenceADN(12,"");
  mosca2.sequenceADN(12,"");
  ebola.sequenceADN(12,"");
  cebra.sequenceADN(12,"");

  cout << endl << "Calculando distancia entre humanos:" << endl;
  float dis = humano.Distance(humano2);
  cout << "Calculando distancia entre ratones:" << endl;
  float dis2 = raton.Distance(raton2);
  cout << "Calculando distancia entre gusanos:" << endl;
  float dis3 = gusano.Distance(gusano2);
  cout << "Calculando distancia entre moscas:" << endl;
  float dis4 = mosca.Distance(mosca2);
  cout << "Calculando distancia entre humano y ebola:" << endl;
  float dis5 = humano.Distance(ebola);
  cout << "Calculando distancia entre raton y cebra:" << endl << endl;
  float dis6 = raton.Distance(cebra);

  cout << "La distancia entre humanos: " << dis << endl;
  cout << "La distancia entre ratones: " << dis2 << endl;
  cout << "La distancia entre gusanos: " << dis3 << endl;
  cout << "La distancia entre moscas: " << dis4 << endl;
  cout << "La distancia entre humano y ebola: " << dis5 << endl;
  cout << "La distancia entre raton y cebra: " << dis6 << endl;

  return 0;

}
